-- ----------------------------
-- Procedure structure for CREATE_FUNC_CHILDREN
-- ----------------------------
DROP PROCEDURE IF EXISTS `CREATE_FUNC_CHILDREN`;
delimiter ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `CREATE_FUNC_CHILDREN`(IN ROOT_ID INT,IN ROOT_ID2 INT)
BEGIN
  DECLARE done INT DEFAULT 0;
  DECLARE b INT;
  DECLARE cur1 CURSOR FOR SELECT FUN_ID FROM SYS_FUN where PARENT_ID=ROOT_ID2;
  DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;
  OPEN cur1;
  FETCH cur1 INTO b;
  WHILE done=0 DO
    CALL CREATE_FUNC_CHILDREN(ROOT_ID, b);
    FETCH cur1 INTO b;
  END WHILE;
  CLOSE cur1;
END
;;
delimiter ;

-- ----------------------------
-- Function structure for GET_FUNC_CHILDREN
-- ----------------------------
DROP FUNCTION IF EXISTS `GET_FUNC_CHILDREN`;
delimiter ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `GET_FUNC_CHILDREN`(ROOT_ID INT) RETURNS varchar(1000) CHARSET utf8
BEGIN
  DECLARE sTemp VARCHAR(1000);
  DECLARE sTempChd VARCHAR(1000);
  SET sTemp = '$';
  SET sTempChd =cast(ROOT_ID as CHAR);
  WHILE sTempChd is not null DO
    SET sTemp = concat(sTemp,',',sTempChd);
    SELECT group_concat(FUN_ID) INTO sTempChd FROM SYS_FUN where FIND_IN_SET(PARENT_ID,sTempChd)>0;
  END WHILE;
  RETURN sTemp;
END
;;
delimiter ;

