-- ----------------------------
DROP FUNCTION IF EXISTS `GET_FUN_NAME`;
delimiter ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `GET_FUN_NAME`(P_FUN_ID INT) RETURNS varchar(64) CHARSET utf8
BEGIN
  DECLARE V_FUN_NAME VARCHAR(64);
  SELECT FUN_NAME INTO V_FUN_NAME FROM SYS_FUN WHERE FUN_ID = P_FUN_ID;
  RETURN V_FUN_NAME;
END
;;
delimiter ;

-- ----------------------------
-- Function structure for GET_MENU_CHILDREN
-- ----------------------------
DROP FUNCTION IF EXISTS `GET_MENU_CHILDREN`;
delimiter ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `GET_MENU_CHILDREN`(ROOT_ID INT) RETURNS varchar(1000) CHARSET utf8
BEGIN
  DECLARE sTemp VARCHAR(1000);
  DECLARE sTempChd VARCHAR(1000);
  SET sTemp = '$';
  SET sTempChd =cast(ROOT_ID as CHAR);
  WHILE sTempChd is not null DO
    SET sTemp = concat(sTemp,',',sTempChd);
    SELECT group_concat(MENU_ID) INTO sTempChd FROM SYS_MENU where FIND_IN_SET(PARENT_ID,sTempChd)>0;
  END WHILE;
  RETURN sTemp;
END
;;
delimiter ;

